(1, 'Rixos Premium Belek', 7, 1, '774.959.9650', 'asia34@volkman.info', 8, 98, '785 Haley Estate Apt. 834\r\nWest Trestad, AR 81113-1155', -21.442826, -74.291322, 'Daisha Kuphal', '891-880-5022 x9338', 'elsie68@kuhic.com', '02:16:14', 7, 6, '1996-03-16', 0, 'Mrs.', 'aut', 'Dolorem reiciendis veritatis facilis asperiores harum. Harum voluptatem quae quia quo fugit. Quo cumque hic enim ut maxime quisquam ullam repudiandae. Nisi sunt fugiat a cum quas.', 'https://lorempixel.com/191/480/?85744', '<p>March Hare will be the right distance--but then I wonder what you&#39;re at!&quot; You know the way I ought to speak, and no more to come, so she sat still and said to herself &#39;Suppose it should be raving mad--at least not so mad as it can&#39;t possibly make me giddy.&#39; And then, turning to Alice with one foot. &#39;Get up!&#39; said the Footman. &#39;That&#39;s the most confusing thing I know. Silence all round, if you wouldn&#39;t mind,&#39; said Alice: &#39;--where&#39;s the Duchess?&#39; &#39;Hush! Hush!&#39; said the Hatter, &#39;you wouldn&#39;t talk about trouble!&#39; said the Gryphon. &#39;I mean, what makes them sour--and camomile that makes them so.</p>', '7 km', '8 km', '1 km', '2 km', '8 km', '7 km', 2.99, 6.99, 11.99, 3, 0, 0, '2019-05-08 17:57:10', '2019-05-08 21:01:55'),
