INSERT INTO `static_pages` (`id`, `menu_id`, `tr_description`, `en_description`, `ru_description`, `ar_description`, `created_at`, `updated_at`) VALUES
(1, 1, '<ul>\r\n	<li>\r\n	<h1>Hakkımızda</h1>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Hacegan Seyahat Acentası T.C. Turizm Bakanlığı ve T&Uuml;RSAB tarafından 18/03/2019 tarihinde verilen 11305 numaralı A Grubu İşletme Belgesine sahiptir.</strong></p>\r\n\r\n<p><strong>K&ouml;kl&uuml; bir Turizm ge&ccedil;mişi ve profesyonel boyuttaki organizasyonlarımız yanı sıra hayata ge&ccedil;irdiğimiz</strong> <a href=\"http://www.halalhotelcheck.com\">www.halalhotelcheck.com</a> <strong>ile İslam d&uuml;nyasındaki &uuml;lkeler ve birbirinden farklı otelleri misafirlerimizle buluşturuyoruz. Aile değerlerimize uygun helal boyutta hizmet eden otelleri firmamız adına &ouml;nce biz g&ouml;r&uuml;p değerlendiriyoruz.</strong></p>\r\n\r\n<p><strong>Tatil otelleri</strong></p>\r\n\r\n<p><strong>Şehir otelleri</strong></p>\r\n\r\n<p><strong>Termal oteller</strong></p>\r\n\r\n<p><strong>Kayak otelleri</strong></p>\r\n\r\n<p><strong>Ailelere &ouml;zel Villalar</strong></p>\r\n\r\n<p><strong>&nbsp;Kriterlerimizin en başından itibaren helal yiyecek, alkols&uuml;z i&ccedil;ecekler, bay bayan havuz ve plajlar, bay bayan Aqua Park, &ccedil;ocuklarınız i&ccedil;in Mini Club, ailenize uygun sosyal alanlar, g&uuml;nd&uuml;z ve gece aktiviteleri ile huzur i&ccedil;inde ibadetimizi yapabileceğimiz mescitler baz alınarak siz değerli misafirlerimize en iyi hizmeti sunmaktayız.</strong></p>\r\n\r\n<p><strong>Online satış kanalı</strong> <a href=\"http://www.halalhotelcheck.com\">www.halalhotelcheck.com</a> &nbsp;<strong>tecr&uuml;be ve birikimleri ile &ccedil;ıktığı bu yolda g&uuml;ler y&uuml;zl&uuml; &ccedil;alışanlarıyla sizlere g&uuml;ven verecektir. Hizmetlerimiz sadece rezervasyon yapmakla sınırlı kalmayıp satış danışmanlarımız, rezervasyon esnasında ve satış sonrasında misafir memnuniyetini en &uuml;st seviyeye taşıyacak bilgi ve beceriye sahiptir,</strong></p>\r\n\r\n<p><strong>Konaklama yapacağınız otellere ulaşımınızdaki zorlukları ve bu zorlukların tesisi tercih edip etmemekte b&uuml;y&uuml;k rol oynadığını biliyoruz. İster Online kanalımızda isterseniz satış danışmanlarımızla birebir g&ouml;r&uuml;şmelerinizle tatil otellerine yapacağınız rezervasyonlarınız i&ccedil;in u&ccedil;ak bileti, Transfer veya Rent a Car hizmetlerimiz, tatil tercihlerinize etki edecektir.</strong></p>\r\n\r\n<p><strong>Helal konsepti i&ccedil;erisinde rehber hizmeti veren ilk Helal Turizm Firması olarak, helal normlardaki tatilinizin iyi bir şekilde ge&ccedil;mesi i&ccedil;in hizmetlerimiz bulunmaktadır. Sizinle y&uuml;z y&uuml;ze g&ouml;r&uuml;şmeler sağlayacak olan rehberimiz tatiliniz esnasındaki olası olumsuzlukları gidermek ve tatil s&uuml;recinizdeki yapmayı planladığınız;</strong></p>\r\n\r\n<p><strong>Rafting</strong></p>\r\n\r\n<p><strong>Şehir Turu</strong></p>\r\n\r\n<p><strong>Dolphin Show</strong></p>\r\n\r\n<p><strong>Tekne Turu</strong></p>\r\n\r\n<p><strong>Safari</strong></p>\r\n\r\n<p><strong>Quad</strong></p>\r\n\r\n<p><strong>Su Altı Dalış</strong></p>\r\n\r\n<p><strong>aktivitelerinize de danışmanlık edecektir.</strong></p>\r\n\r\n<p><strong>Ailenizle birlikte helal normlarda yaşayacağınız tatiller i&ccedil;in elimizden gelenin en iyisini yapmaya &ccedil;alışmaktayız. Size &ouml;zel tatil planlarınızı ger&ccedil;eğe d&ouml;n&uuml;şt&uuml;rmek i&ccedil;in, online kanalımız olan</strong> <a href=\"http://www.halalhotelcheck.com\">www.halalhotelcheck.com</a> <strong>ya da birebir destek alabileceğiniz satış ekibimizle biz hazırız.</strong></p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '2019-05-20 11:15:13', '2019-05-22 09:44:25'),
(2, 2, '<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;İLETİŞİM</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></p>\r\n\r\n<p><strong>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ</strong></p>\r\n\r\n<p><strong>HACEGAN TUR</strong></p>\r\n\r\n<p><strong>Adres&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Avsallar Mh. Bah&ccedil;e sk. No : 22 Alanya / ANTALYA / T&Uuml;RKİYE</strong></p>\r\n\r\n<pre>\r\n<strong>Kurumsal               <a href=\"mailto:info@halalhotelcheck.com\">info@halalhotelcheck.com</a></strong></pre>\r\n\r\n<p><strong>Satış &amp; Pazarlama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"mailto:satis@halalhotelcheck.com\">satis@halalhotelcheck.com</a></strong></p>\r\n\r\n<p><strong>Yeni otel Ekleme&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"mailto:oteldestek@halalhotelcheck.com\">oteldestek@halalhotelcheck.com</a></strong></p>\r\n\r\n<p><strong>Muhasebe&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"mailto:muhasebe@halalhotelcheck.com\">muhasebe@halalhotelcheck.com</a></strong></p>\r\n\r\n<p><strong>İnsan Kaynakları&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"mailto:ik@halalhotelcheck.com\">ik@halalhotelcheck.com</a></strong></p>\r\n\r\n<p><strong>Telefon No&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0 242 517 14 05 &ndash; 0 850 466 39 87</strong></p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp