(4, 6, '<p><strong>KULLANICI SATIŞ S&Ouml;ZLEŞMESİ</strong></p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>1-) KONUSU :</strong><br />\r\nİş bu s&ouml;zleşmenin konusu, M&uuml;şteriye satışının yapıldığı seyahat servislerinin ifa şekli ile tarafların hak ve y&uuml;k&uuml;ml&uuml;l&uuml;klerini kapsamaktadır.<br />\r\n&nbsp;<br />\r\n<strong>2-) FİYAT VE &Ouml;DEME ŞEKLİ</strong><br />\r\nVerilen hizmetlerin toplam fiyatına t&uuml;m vergiler dahildir.&nbsp;<br />\r\nBu bedel hizmeti sağlayan tedarik&ccedil;inin (konaklama, u&ccedil;uş, transfer veya tur sağlayan firmanın) belirlediği &ouml;deme şekline g&ouml;re<br />\r\n1.&nbsp;&nbsp; &nbsp;Rezervasyon anında kredi kartı ile veya&nbsp;<br />\r\n2.&nbsp;&nbsp; &nbsp;EFT/Havale ile belirtilen banka hesaplarına<br />\r\n3.&nbsp;&nbsp; &nbsp;İlgili konaklama veya ulaştırma hizmeti anında &ouml;denebilir.<br />\r\n&ouml;demenin s&ouml;zleşme ile hemen veya sonradan yerinde hizmetin ifası sırasında yapılacak tutarları alışveriş sepetinde şimdi &ouml;denecek ve yerinde &ouml;denecek ifadeleri ile net bir şekilde belirtilecektir.</p>\r\n\r\n<p><strong>4-) HIZMET TANITIM BİLGİLERİ :</strong><br />\r\nSeyahat ve turizm hizmetinin detaylı tanıtımı, &Uuml;r&uuml;n ile ilgili tanıtım ve satış sayfasında mevcuttur.</p>\r\n\r\n<p><strong>5-) DEVİR</strong><br />\r\nYapılan &nbsp;konaklama hizmetlerinde devir hakkı hizmet sağlayıcının belirlediği kurallara g&ouml;re sağlanır ; bu durumda m&uuml;şteri en az 7 g&uuml;n &ouml;nceden durumu bildirmelidir.</p>\r\n\r\n<p><strong>6-) İPTAL ve DEĞİŞİKLİK</strong><br />\r\n7.1 T&uuml;ketici rezervasyonunu kendisinin veya 1. derecede akrabalarının 10 g&uuml;nl&uuml;k mutat iştigaline engel rahatsızlıklarını ve &ouml;l&uuml;mleri tam teşekk&uuml;ll&uuml; devlet hastanesinden alınacak resmi rapor ile belgelemeleri halleri dışında kalan bir sebep ile gezinin başlamasından 60 g&uuml;n kalaya kadar yapılan iptallerde, ulaşım ve vize gibi ekstra hizmetler tutarları hari&ccedil; T&Uuml;KETİCİ&#39;ye o ana kadar &ouml;dediği &uuml;cretinin tamamı iade edilir.<br />\r\nT&Uuml;KETİCİ, seyahat ve konaklamanın&nbsp; başlamasından &ouml;nce tesisin belirleyeceği g&uuml;n aralıklarında s&ouml;zleşmeyi iptal etmesi halinde tesisin belirlediği g&uuml;nler &ccedil;er&ccedil;evesinde konaklama bedelinin %&rsquo;lik oranlarına denk gelen miktarlar kadar Hacegan tur&rsquo;a &ouml;demeyi kabul ve taahh&uuml;t eder.&nbsp;</p>\r\n\r\n<p>T&Uuml;KETİCİ, hizmetin başlamasına tesisin belirlediği g&uuml;n kalaya kadar iptal talep ettiğinde &ouml;dediği bedelin ulaşım ve vize gibi ekstra hizmetler tutarları hari&ccedil; tamamı kendisine iade edilir.</p>\r\n\r\n<p><strong>7-) OTELİN S&Ouml;ZLEŞMEYİ FESHETMESİ :</strong><br />\r\nOtelin&nbsp;haklı nedenler olmaksızın keyfi olarak s&ouml;zleşmeyi feshetmesi halinde, t&uuml;ketici uğradığı zarar oranında tazminat hakkına sahip olur. Ayrıca,&nbsp;Otel, t&uuml;keticinin o g&uuml;ne kadar yaptığı t&uuml;m &ouml;demeleri ve t&uuml;keticiyi bor&ccedil; altına sokan t&uuml;m belgeleri 10 g&uuml;n i&ccedil;inde t&uuml;keticiye iade eder.<br />\r\nS&ouml;zleşmenin feshi,&nbsp;Otel&nbsp;gerekli t&uuml;m &ouml;zeni g&ouml;stermiş olmasına rağmen, m&uuml;cbir sebeplerden kaynaklanması halinde t&uuml;keticinin tazmin hakkı doğmaz.</p>\r\n\r\n<p><strong>8-) BİLDİRİM S&Uuml;RESİ :</strong><br />\r\nT&uuml;ketici, s&ouml;zleşmenin hi&ccedil; ya da gereği gibi ifa edilmemesi halini, hizmetin ifa edilmesi gerektiği ya da ifa edildiği tarihten itibaren 7 g&uuml;n i&ccedil;erisinde hacegan tur&rsquo;a bildirmek zorundadır.</p>\r\n\r\n<p><strong>9-) SORUMLULUK :</strong>, s&ouml;zleşmeden doğan y&uuml;k&uuml;ml&uuml;l&uuml;klerin hi&ccedil; yada gereği gibi ifa edilmemesinden dolayı otel sorumludur. Ancak s&ouml;zleşmenin hi&ccedil; ya da gereği gibi ifa edilmemesi t&uuml;keticinin veya 3.kişilerin kusuruna veya m&uuml;cbir bir sebebe dayanıyorsa, otel ve acenta sorumlu tutulamaz.&nbsp;</p>\r\n\r\n<p><strong>10-) M&Uuml;CBİR SEBEPLER :</strong><br />\r\nOtel, her t&uuml;rl&uuml; olumsuz hava koşulları, yol engeli, grev, ter&ouml;r, sis, fırtına, savaş, savaş ihtimali, tabi afetler, devletler arası ilişkilerde yaşanan değişiklik ve olumsuz gelişmeler, halk hareketleri, &ouml;ng&ouml;r&uuml;lemez teknik hususlar, iflas, m&uuml;cbir sebepler gibi iradesi dışında oluşan sebeplerden dolayı konaklamayı iptal veya tehir edebilir. Bu durumda halalhotelceheck.com hi&ccedil;bir şekilde sorumlu değildir ve t&uuml;ketici hi&ccedil;bir hak ve alacak talebinde bulunamaz.</p>\r\n\r\n<p><strong>11-) BAGAJ :</strong><br />\r\n13.1 Kokan , akan, yanıcı veya patlayıcı vasıfları olan veya &ccedil;evresine rahatsızlık veren eşyalar ile kesici delici, ve ateşli silahlar ve her &ccedil;eşit hayvan, otelin ayrıca ve a&ccedil;ık&ccedil;a yazılı izin olmadan taşıt ara&ccedil;larına ve konaklanacak tesislere alınmazlar.<br />\r\n13.2 Hotel personelinin ağır kusurundan kaynaklanan bagaj kaybı veya hasarı durumunda kaybolan veya hasar g&ouml;ren bagajın i&ccedil;inde bulunan eşyaların maddi ve manevi değer ile sair vasıf ve &ouml;zellikleri g&ouml;zetilmeksizin gezinin toplam bedeli i&ccedil;inde ulaşıma isabet eden kısmının %50; si kaybolan eşya sahibine &ouml;denir. Otel, t&uuml;ketici tarafından kendisine yazılı olarak kıymetleri ile birlikte deklare edilerek teslim edilmiş eşyanın her t&uuml;rl&uuml; kaybından, hasarından ve &ccedil;alınmasından en &ccedil;ok gezinin bedeli kadar sorumludur.</p>\r\n\r\n<p><strong>12-) DİĞER H&Uuml;K&Uuml;MLER :</strong><br />\r\n15.1 T&uuml;keticinin, hizmetin kusurlu olduğundan bahisle oteli terk etmesi halinde, oteli terk ettiğini Otel yetkilisine sebepleri ile birlikte yazılı olarak bildirmek zorundadır. Aksi halde t&uuml;ketici oteli terk etmiş sayılmış ve hizmeti alıp kullanmış addolunur.</p>\r\n\r\n<p><br />\r\n15.2 T&uuml;keticinin şikayet&ccedil;i olduğu hususları hizmetin ifası sırasında yazılı olarak yetkiliye bildirmesi iyi niyetli t&uuml;keticinin &ouml;zen borcudur. T&uuml;ketici&#39; nin şikayet&ccedil;i olduğu halde hizmeti sonuna kadar kullanması şikayet&ccedil;i olduğu hususlar ile ilgili ikame hizmet ve bedel iadesi gibi tazminat haklarını ortadan kaldırır.<br />\r\n15.3 S&ouml;zleşmede imzası bulunmayan ancak s&ouml;zleşmeye konu konaklamaya katılan t&uuml;ketici (ler) de kendi adlarına kayıt yaptırmakla g&ouml;revlendirdikleri t&uuml;ketici(ler) bu s&ouml;zleşmeyi okuyup kabul ve taahh&uuml;t etmiş sayılırlar. Buna rağmen, s&ouml;zleşmede bizzat imzalarının olmadığı gerek&ccedil;esiyle t&uuml;ketici (ler) in otelin aleyhine dava ve takipler ve otelin t&uuml;keticiye bu s&ouml;zleşmede yazılı hususlar dışında bir bedel ya da tazminat &ouml;demek zorunda kalması halinde otelin s&ouml;zleşmede imzası bulunan t&uuml;ketici(ler) ye &ouml;demiş olduğu fazla miktar i&ccedil;in r&uuml;cu hakkı mahfuzdur. T&uuml;keticiler imzalamış olmasalar dahi taraflar arasında ge&ccedil;erli olacak bu s&ouml;zleşme şartlarını katalog ve ilanlar nedeni ile &ouml;ğrenmiş, otelde bu s&ouml;zleşme şartlarında katılmayı taahh&uuml;t etmişlerdir.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>13-) Y&Uuml;R&Uuml;RL&Uuml;K:</strong><br />\r\nM&uuml;şteri bu s&ouml;zleşmede bahsi ge&ccedil;en hizmetin nitelikleri, satış fiyatı ve &ouml;deme şekli, fiyatların ge&ccedil;erlilik tarihi ile ifaya ilişkin t&uuml;m &ouml;n bilgileri okuyup bilgi sahibi olduğunu ve elektronik ortamda gerekli teyidi verdiğini beyan eder.&nbsp;<br />\r\nİş bu s&ouml;zleşme M&uuml;şterinin onaylaması ile y&uuml;r&uuml;rl&uuml;ğe girecek olup taraflarca y&uuml;r&uuml;rl&uuml;k tarihinin onaylama tarihi olacağı kabul edilmektedir. M&uuml;şteri bu s&ouml;zleşmeyi okumadan ve onaylamadan web sistemi i&ccedil;erisinde kademe atlayamayacak olup bu s&ouml;zleşmeyi okumak mecburiyetindedir. Bu s&ouml;zleşme hizmetin M&uuml;şteri tarafından alınması ve t&uuml;ketilmesi ya da herhangi bir şekilde iptale konu olması halinde son bulur.</p>\r\n\r\n<p><strong>14-) YETKİLİ MAHKEME :</strong></p>\r\n\r\n<p>Bu s&ouml;zleşmeden doğan uyuşmazlıkların &ccedil;&ouml;z&uuml;m&uuml;nde Antalya Mahkemeleri ve İcra Daireleri yetkilidir.<br />\r\n&nbsp;Yukarda belirtilen ve on d&ouml;rt maddeden oluşan otel konaklama t&uuml;m maddeleri, taraflar arasında m&uuml;zakere edilerek kendi &ouml;zg&uuml;r iradeleri ile d&uuml;zenlenmiştir.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '2019-05-24 19:08:35', '2019-05-24 19:08:35'),
(5, 9, '<p><strong>WEB SİTESİ GİZLİLİK S&Ouml;ZLEŞMESİ</strong></p>\r\n\r\n<p>Bu web sitesini ziyaret etmeniz ve bu site vasıtasıyla sunduğumuz hizmetlerden yararlanmanız sırasında size ve talep ettiğiniz hizmetlere ilişkin olarak elde ettiğimiz bilgilerin ne şekilde kullanılacağı ve korunacağı işbu &quot;Gizlilik Politikası&quot;nda belirtilen şartlara tabidir. Bu web sitesini ziyaret etmekle ve bu site vasıtasıyla sunduğumuz hizmetlerden yararlanmayı talep etmekle işbu &quot;Gizlilik Politikası&quot;nda belirtilen şartları kabul etmiş olursunuz.</p>\r\n\r\n<p><strong>Bilgilerin Kullanılması ve Korunması</strong></p>\r\n\r\n<p>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya Halalhotelcheck.com adı altında varlık g&ouml;steren diğer şirketler, m&uuml;şterilerine daha iyi hizmet verebilmek amacıyla bazı kişisel bilgilerinizi (isim, soy isim, yaş, e-posta, telefon vb&hellip;) sizlerden talep etmektedir.&nbsp;</p>\r\n\r\n<p>Toplanan bu kişisel bilgilerden elde edilebilecek istatistik veriler (tarayıcı tipi, coğrafi konum, yaş, cinsiyet, v.b.), d&ouml;nemsel kampanya &ccedil;alışmaları, e-b&uuml;lten &ccedil;alışmaları, m&uuml;şteri profillerine y&ouml;nelik &ouml;zel promosyon faaliyetlerinin kurgulanması ve istenmeyen e-postaların iletilmemesine y&ouml;nelik m&uuml;şteri &quot;sınıflandırma&quot; &ccedil;alışmalarında MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya Halalhotelcheck.com adı altında varlık g&ouml;steren diğer şirketler b&uuml;nyesinde kullanılmaktadır.&nbsp;</p>\r\n\r\n<p>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya Halalhotelcheck.com adı altında varlık g&ouml;steren diğer şirketler, &uuml;yelik formlarından topladığı bilgileri, s&ouml;z konusu &uuml;yenin haberi ya da aksi bir talimatı olmaksızın, &uuml;&ccedil;&uuml;nc&uuml; şahıslarla kesinlikle paylaşmamakta, faaliyet dışı hi&ccedil;bir nedenle ticari ama&ccedil;la kullanmamakta ve de satmamaktadır.&nbsp;</p>\r\n\r\n<p>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya Halalhotelcheck.com adı altında varlık g&ouml;steren diğer şirketler, e-posta adresleri ve &uuml;yelik formlarında istediği kişisel bilgilerin haricinde site kullanımı sırasında izlediği, ziyaret&ccedil;i hareket ve tercihlerini analiz ederek yorumlamaktadır. Kişisel bilgiler i&ccedil;ermeyen bu istatistiksel veriler, misafirlere daha &ouml;zel ve etkin bir rezervasyon deneyimi yaşatmak amacıyla kullanılmaktadır.</p>\r\n\r\n<p>Halalhotelcheck.com e-b&uuml;lten listesinden ayrılmak istiyorsanız, e-b&uuml;ltenin en alt b&ouml;l&uuml;m&uuml;nde bulunan &quot;bu b&uuml;lteni bir daha almak istemiyorsanız <strong>buraya</strong> tıklayınız.</p>\r\n\r\n<p>M&uuml;şteri bilgileri, ancak resmi makamlarca usul&uuml; dairesinde bu bilgilerin talep edilmesi halinde ve y&uuml;r&uuml;rl&uuml;kteki emredici mevzuat h&uuml;k&uuml;mleri gereğince resmi makamlara a&ccedil;ıklama yapmak zorunda olduğu durumlarda resmi makamlara a&ccedil;ıklanabilecektir.&nbsp;</p>\r\n\r\n<p>Kullanıcı bu Web Sitesi&rsquo;nden veya Web Sitesi aracılığıyla elde edilen bilgileri, yazılımları, &uuml;r&uuml;nleri&nbsp;veya hizmetleri tadil etmemeyi, kopyalamamayı, dağıtımını yapmamayı, iletmemeyi, teşhir&nbsp;etmemeyi, icra etmemeyi, &ccedil;oğaltmamayı, yayımlamamayı, lisanslamamayı, bunlardan t&uuml;revsel&nbsp;&ccedil;alışmalar &uuml;retmemeyi, bunları devretmemeyi, satmamayı taahh&uuml;t ve kabul etmektedir. Kullanıcı&nbsp;ayrıca aşağıdaki edimlerde bulunmamayı taahh&uuml;t ve kabul etmektedir:&nbsp;(i) Yazılı olarak www.halalhotelcheck.com&rsquo;un &ouml;nceden vereceği a&ccedil;ık izin olmaksızın, herhangi bir ama&ccedil;la robot,&nbsp;&ouml;r&uuml;mcek, kazıyıcı veya&nbsp;diğer otomatik ara&ccedil;ları kullanarak veya manuel işlemler aracılığıyla bu Web&nbsp;Sitesi&rsquo;nde yer alan bir i&ccedil;eriğe veya bilgiye erişimde bulunulması, bunların izlenmesi veya &nbsp;kopyalanması;</p>\r\n\r\n<p>Bu Web Sitesi&rsquo;nde bulunan robot istisnası başlığında belirtilen sınırlamaların ihlal edilmesi veya&nbsp;bu Web Sitesi&rsquo;ne yapılan erişimleri &ouml;nlemek veya sınırlandırmak i&ccedil;in kullanılan diğer &ouml;nlemlerin&nbsp;</p>\r\n\r\n<p>baypas edilmesi veya işlevsiz hale getirilmesi;</p>\r\n\r\n<p>iii) Takdir hakkı www.halalhotelcheck.com&rsquo;a ait olmak &uuml;zere, altyapıya makul olmayan veya orantısız şekilde&nbsp;y&uuml;ksek bir y&uuml;k bindiren veya bindirebilecek olan bir işlemde bulunulması;</p>\r\n\r\n<p>(iv) www.halalhotelcheck.com tarafından yazılı olarak &ouml;nceden verilecek a&ccedil;ık izin olmaksızın, herhangi bir&nbsp;maksatla bu Web Sitesi&rsquo;nin herhangi bir kısmına y&ouml;nelik gizli link konulması;</p>\r\n\r\n<p>(v) www.halalhotelcheck.com tarafından yazılı olarak &ouml;nceden verilecek a&ccedil;ık izin olmaksızın bu Web Sitesi&rsquo;nin&nbsp;herhangi bir kısmının diğer bir web sitesine &quot;frame edilmesi&quot;, &quot;olduğu gibi kopyalanması&quot; veya diğer&nbsp;şekillerde dahil edilmesi;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>(vi) Bu Web Sitesi veya hizmetlerle bağlantılı olarak, www.halalhotelcheck.com tarafından kullanılan bir yazılım&nbsp;programının değiştirilmesi, terc&uuml;me edilmesi, uyarlanması, editlenmesi, geri derlenmesi, &ouml;ğelerine&nbsp;ayrıştırılması veya geri m&uuml;hendisliğe tabi tutulmasına y&ouml;nelik girişimlerde bulunulması.</p>\r\n\r\n<p>(vii) Kullanıcının Web Sitesi&rsquo;nin kullanımından ve/veya teşhirinden doğan haklarını &uuml;&ccedil;&uuml;nc&uuml; kişilere&nbsp;devretmesi.</p>\r\n\r\n<p>Kullanıcı, www.halalhotelcheck.com Web Sitesi aracılığı ile bir &uuml;r&uuml;n ya da hizmet satın aldığında, adını, e-posta&nbsp;adresini, kredi ya da banka kartı numarasını, kartın son kullanma tarihini ve telefon numarasını&nbsp;belirtmelidir. , www.halalhotelcheck.com Kullanıcının siparişini işlemek ve siparişin durumu hakkında bilgi&nbsp;vermek amacıyla, Kullanıcının telefon numarasını kendi mesajlaşma hizmetine dahil etme hakkına&nbsp;sahiptir.</p>\r\n\r\n<p>&Ouml;deme sayfasında istenen kredi kartı bilgileriniz, siteden alışveriş yapan misafirlerimizin g&uuml;venliğini en &uuml;st seviyede tutmak amacıyla &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.. uygulaması ile alınmaktadır. Bu şekilde &ouml;demeye y&ouml;nelik t&uuml;m işlemlerin halalhotelcheck.com ara y&uuml;z&uuml; &uuml;zerinden banka ve bilgisayarınız arasında ger&ccedil;ekleşmesi sağlanmaktadır.</p>\r\n\r\n<p>Kullanıcı tarafından , www.halalhotelcheck.com Web Sitesi aracılığı ile yapılmış bir &uuml;r&uuml;n ve hizmet alımında&nbsp;kullanılan kredi kartı g&uuml;venliğinden Kullanıcı bizzat sorumlu olup, yasal zorunluluklar nedeni ile&nbsp;gerekmesi halinde kredi kartına ait belgeleri ibraz etmeyi kabul ve taahh&uuml;t eder. Kullanıcının , www.halalhotelcheck.com web sitesi &uuml;zerinden yapacağı t&uuml;m işlemlerin, internet sayfalarında&nbsp;g&ouml;sterilen şekilde&nbsp;tam olarak yapılması şarttır. İşlemin Kullanıcı tarafından yanlış veya hatalı &nbsp;yapılması nedeniyle rezervasyon, rezervasyon değişikliği, iptal, iade ve on-line bilet satın alma&nbsp;işlemlerinde &ccedil;ıkabilecek aksaklıklardan , www.halalhotelcheck.com sorumlu değildir.</p>\r\n\r\n<p>İnternetin yapısı gereği bilgiler internet &uuml;zerinde yeterli g&uuml;venlik &ouml;nlemleri olmasına rağmen dolaşabilir ve yetkili olmayan kişiler tarafından alınıp kullanılabilir. Bu kullanım ve kullanımdan doğacak zarar MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya HACEGAN TUR adı altında varlık g&ouml;steren diğer şirketlerin sorumluluğunda değildir.&nbsp;</p>\r\n\r\n<p>Toplanan bilgiler genel kullanıma a&ccedil;ık olmayan g&uuml;venli bir ortamda saklanır.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Gizlilik ve Kişisel Verilerin Korunması Politikası&nbsp;</strong></p>\r\n\r\n<p>Web sitesine kaydedilen bilgilerin doğruluğundan Kullanıcı sorumludur.&nbsp;www.halalhotelcheck.com, bilgileri sadece bu web sitesinde işlem yapılabilmesini sağlamak amacıyla&nbsp;tutmaktadır. Ancak, Kullanıcı i&ccedil;in yararlı olacağını ya da Kullanıcının ilgisini &ccedil;ekeceğini d&uuml;ş&uuml;nd&uuml;ğ&uuml;&nbsp;&uuml;&ccedil;&uuml;nc&uuml; şirketlerin &ouml;nerileri ve promosyonları hakkında danışmanlık ve bilgilendirme gibi y&uuml;ksek&nbsp;kaliteli &ouml;zelleştirilmiş hizmetler sunmak i&ccedil;in gerekli kişisel verileri toplar ve kullanabilir.</p>\r\n\r\n<p>Kullanıcı tarafından doğrudan sağlanan verileri ve &ccedil;erezlerin kullanımı da dahil olmak &uuml;zere veri&nbsp;trafiği analizini kullanarak, Kullanıcıların zevkleri ve tercihleri hakkında bilgi toplar. www.halalhotelcheck.com&rsquo;a kayıt olmakla Kullanıcı, aynı zamanda, g&ouml;nderilen reklam mesajlarını da&nbsp;alabileceğini kabul etmiştir. www.halalhotelcheck.com, Kullanıcının kişisel verilerini kendi organizasyonu ve ticari ilişkisi dışında bulunan&nbsp;&uuml;&ccedil;&uuml;nc&uuml; kişilere vermez. www.halalhotelcheck.com, ayrıca, satışlar, m&uuml;şteriler, veri trafiği hakkında k&uuml;resel&nbsp;istatistikleri ve Web Sitesinden diğer bilgileri ticari ilişkisi bulunan bu &uuml;&ccedil;&uuml;nc&uuml; taraflara verebilir.&nbsp;&nbsp;</p>\r\n\r\n<p>Bununla birlikte, bu istatistikler, Kullanıcının kişisel olarak tanımlanmasını m&uuml;mk&uuml;n kılacak herhangi&nbsp;bir veri i&ccedil;eremez. www.halalhotelcheck.com Web Sitesi, &ccedil;erezlerin kullanımı kabul eder. Bir &ccedil;erez, tarayıcının bilgisayarın sabit&nbsp;diskinde depoladığı bir bilgi par&ccedil;asıdır. www.halalhotelcheck.com web sitesi dahilindeki dolaşımlarda oluşmuş&nbsp;&ccedil;erezlerin bir kısmı sabit diskte kaydedilirken bir kısmı ise dolaşım s&uuml;resince korunur, tarayıcının &nbsp;kapatılması neticesinde silinir. &Ccedil;erezlerin sabit diskte kayıtlı &nbsp;tutulmasının amacı www.halalhotelcheck.com web&nbsp;sitesine tekrar girişlere Kullanıcıları tanımlamaktır.</p>\r\n\r\n<p>Bu Web Sitesindeki i&ccedil;eriğin başka şekilde kullanımı, tamamen ya da kısmen &ccedil;oğaltılması, &nbsp;değiştirilmesi, dağıtılması, aktarılması, daha sonra yayınlanması, sergilenmesi ve/veya temsil edilmesi da dahil olmak &uuml;zere kesinlikle yasaklanmıştır. &Ouml;zellikle, www.halalhotelcheck.com Web Sitesinde&nbsp;bulunan g&ouml;r&uuml;nt&uuml;lerin bu Web Sitesi dışında www.halalhotelcheck.com ve/veya Tedarik&ccedil;ilerinin a&ccedil;ık onayı&nbsp;olmadan t&uuml;m kullanımı kesinlikle yasaklanmıştır.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>M&uuml;cbir nedenlerden (politik, ekonomik nedenler ya da g&uuml;venliği etkileyen istikrarsız karmaşa&nbsp;durumu da dahil olmak &uuml;zere) dolayı, www.halalhotelcheck.com tarafından &ccedil;&ouml;z&uuml;lemeyecek beklenmeyen&nbsp;durumlar nedeniyle www.halalhotelcheck.com aracılığı ile satın alınmış &uuml;r&uuml;n ya da hizmetlerin rezervasyonları,&nbsp;onayları ve/veya ger&ccedil;ekleştirilmesinde sorunlar olursa, ya da &uuml;zerinde anlaşılan h&uuml;k&uuml;mlerin hi&ccedil;&nbsp;birine uymak m&uuml;mk&uuml;n olmazsa bile, www.halalhotelcheck.com, bu sorunlar ya da anlaşmaya uymamaktan&nbsp;doğan yasal sorumluluklardan muaftır.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&Uuml;&ccedil;&uuml;nc&uuml; Parti Sitelere Bağlantılarına (Linklere) Dair</strong></p>\r\n\r\n<p>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. veya HACEGAN TUR adı altında varlık g&ouml;steren diğer şirketler, web sitesindeki bağlantılar aracılığıyla ulaşacağınız &uuml;&ccedil;&uuml;nc&uuml; kişilere ait web sitelerinin gizlilik ilkeleri hakkında bir garanti vermez, bu nedenle kişisel olarak belirlenebilir herhangi bir bilgi vermeden &ouml;nce, gittiğiniz sitelerin gizlilik yaklaşımlarını değerlendirmenizi &ouml;neririz.</p>\r\n\r\n<h3><strong>İletişim</strong></h3>\r\n\r\n<p>Gizlilik s&ouml;zleşmesiyle ilgili sorularınız i&ccedil;in aşağıdaki iletişim bilgilerini kullanarak bize ulaşabilirsiniz.&nbsp;</p>\r\n\r\n<p><strong>MEED TOUR SEYAHAT TURİZM ORG. VE TİC. LTD. ŞTİ. </strong><strong>veya HACEGAN TUR </strong></p>\r\n\r\n<p>Adres: Avsallar Mh. Bah&ccedil;e Sk. No:22 Alanya / ANTALYA</p>\r\n\r\n<p>Tel&nbsp;&nbsp;&nbsp; : 08504663987</p>\r\n\r\n<p>Mail adresi: in